import './HomePage.css'
// import { Link } from 'react-router-dom'
import NavBar from '../NavBar/NavBar'
import { useState, useEffect } from 'react'
import axios from 'axios'
// import axios from '../../../axios'

const URL = "https://api.thedogapi.com/v1/breeds"
const URL_IMG = "https://cdn2.thedogapi.com/images/"
const HomePage = () =>  {
    const [dogs, setDogs] = useState([])

    useEffect(() => {
        const fetchDogs = async (req, res) => {
         try {
            const {data} = await axios(`${URL}`)
            const oland = data.reference_image_id
            const {imgId} = await axios(`${URL_IMG}${oland}`)
            console.log(imgId)
            setDogs(data)
            console.log(data)
         }catch (error){

            return res.status(404).send(error.message)
         }
        }
        fetchDogs() 
    },[])

    return (
        <div className="home_general">
            <NavBar />
            <div>
                {
                    dogs.map((dog) => (
                      <article key={dog.id}>
                        <img src={dog.img_url} alt={dog.name} />
                        <h2>{dog.name}</h2>
                        {/* <p>{dog.breed_group}</p> */}
                      </article>  
                    ))
                }
            </div>
        </div>
    )
}

export default HomePage
